window.bookSummaryJSON = "<p>If they can’t control him. <br> They’ll try and kill him.&nbsp;&nbsp;</p> <p>Daniel Hunt is the deadliest mercenary in the galaxy if he can just remember. Five years before, he woke up with nothing more than his name. Now his present is on a violent collision with his past and the future of the galaxy.&nbsp;&nbsp;</p> <p>The Earth is dead. Humanity has taken to the moon and Mars to have a chance. On what’s left of Earth, primal gangs war for dominance.&nbsp;&nbsp;</p> <p>A rebel force will discover a weapon of unimaginable strength, the wealthy in the galaxy will do anything to possess. As Daniel unravels the origin of his past he’ll realize he’s not the same weapon he once was. But does redemption exist for someone like him?&nbsp;&nbsp;</p> <p>For fans of Jason Bourne and the Weapon X program, this one’s for you. Grab your hand cannon and start listening now!</p>"; 
